import { Typography } from "@mui/material";
import { useDispatch } from "react-redux";
import { addUser } from "../../slices/userSlice";
import { store } from "../../store";
import { AddPlayerButton, AddPlayerButtonContainer, HeaderContainer } from "../../styles/header";

export default function Header() {
    const dispatch = useDispatch();

    const addPlayer = () => {
        console.log(store);
        dispatch(addUser())
    }

    return (
        <HeaderContainer>
            <Typography variant="h1">Phase10</Typography>
            <AddPlayerButtonContainer>
                <AddPlayerButton
                    variant="contained"
                    onClick={addPlayer}>
                    Add player +
                </AddPlayerButton>
            </AddPlayerButtonContainer>
        </HeaderContainer>
    )
}
